import React from 'react';
import { Link } from 'react-router-dom';


function Register(props) {
    return (
        <div className="auth">
            <div className="auth__container">
              <h2 className="auth__title">Регистрация</h2>
              <form className="auth__form" name="auth-form" noValidate>
              <div className="auth__input-zone">
                <input className="auth__input auth__input_type_email" required type="email" placeholder="Email"/>
                <input className="auth__input" required type="text" placeholder="Пароль" />
              </div>
              <button className="auth__submit-button" type="submit" aria-label="Зарегистрироваться">Зарегистрироваться</button>
            </form>
            <Link className="auth__link" to="/signin">Уже зарегистрированы? Войти</Link>
            </div>
        </div>

    )
}

export default Register;
